    public static Document addTitle(String fileName, String title) {

        Document document=new Document(PageSize.A4.rotate(),20,20,20,20);
        PdfWriter writer=null;

        try{
            BaseFont bfChinese=BaseFont.createFont("STSong-Light", "UniGB-UCS2-H", BaseFont.NOT_EMBEDDED);
            Font fontChinese=new Font(bfChinese, 32, Font.BOLD);

            writer=PdfWriter.getInstance(document, new FileOutputStream(fileName));
            writer.setStrictImageSequence(true);
            document.open();

            ItextPDFUtil.addTitle(document, "新东方多媒体学习库", 32);

            // 设置PDF标题
            Paragraph titleGraph=new Paragraph();
            titleGraph.setSpacingBefore(20);
            titleGraph.setSpacingAfter(20);
            titleGraph.setAlignment(1);
            titleGraph.add(new Chunk(title, fontChinese));
            document.add(titleGraph);
        }catch(FileNotFoundException e){
            // TODO Auto-generated catch block
            e.printStackTrace();
        }catch(Exception e){
            // TODO Auto-generated catch block
            e.printStackTrace();
        }

        return document;
    }

    public static Document addTitle(Document document, String title, Integer fontsize) {
        int Alignment=Element.ALIGN_CENTER;
        addTitle(document, title, fontsize, Alignment);
        return document;
    }

    public static void addTitle(Document document, String title, Integer fontsize, int Alignment) {
        float defaultSpacingBefore=20;
        float defaultSpacingAfter=8;
        addTitle(document, title, fontsize, Alignment, defaultSpacingBefore, defaultSpacingAfter);
    }

    /**
     * 添加空行
     * @param document
     */
    public static void addBlankLine(Document document) {
        float defaultSpacingBefore=0;
        float defaultSpacingAfter=2;
        addTitle(document, "", 26, Element.ALIGN_CENTER, defaultSpacingBefore, defaultSpacingAfter);
    }
    public static void addTitle(Document document, String title, Integer fontsize, int Alignment, float defaultSpacingBefore, float defaultSpacingAfter) {
        PdfWriter writer=null;
        try{
            BaseFont bfChinese=BaseFont.createFont("STSong-Light", "UniGB-UCS2-H", BaseFont.NOT_EMBEDDED);
            Font fontChinese=new Font(bfChinese, fontsize, Font.BOLD);
            // 设置PDF标题
            Paragraph titleGraph=new Paragraph();
            titleGraph.setSpacingBefore(defaultSpacingBefore);
            titleGraph.setSpacingAfter(defaultSpacingAfter);
            titleGraph.setAlignment(Alignment);
            titleGraph.add(new Chunk(title, fontChinese));
            document.add(titleGraph);
        }catch(FileNotFoundException e){
            // TODO Auto-generated catch block
            e.printStackTrace();
        }catch(Exception e){
            // TODO Auto-generated catch block
            e.printStackTrace();
        }
    }

    public static Document addImgsTable(Document document, String[] bese64Img, String[] title) {

        BaseFont bfChinese=null;
        try{
            bfChinese=BaseFont.createFont("STSong-Light", "UniGB-UCS2-H", BaseFont.NOT_EMBEDDED);
        }catch(DocumentException e1){
            e1.printStackTrace();
        }catch(IOException e1){
            e1.printStackTrace();
        }
        Font fontChinese=new Font(bfChinese, 14, Font.NORMAL);

        PdfPTable tableImg=new PdfPTable(2);
        tableImg.setHorizontalAlignment(PdfPTable.ALIGN_LEFT);
        try{
            tableImg.setTotalWidth(new float[] { 400.0f, 400.0f });
        }catch(DocumentException e){
            e.printStackTrace();
        }

        if(bese64Img.length==1){
            tableImg=new PdfPTable(1);
            tableImg.setHorizontalAlignment(PdfPTable.ALIGN_LEFT);
            try{
                tableImg.setTotalWidth(new float[] { 800.0f });
            }catch(DocumentException e){
                e.printStackTrace();
            }
        }

        tableImg.setLockedWidth(true);
        // 创建一个表格的表头单元格
        PdfPCell imgCell=new PdfPCell();
        imgCell.setBorderWidth(0);
        imgCell.setHorizontalAlignment(PdfPCell.ALIGN_CENTER);
        imgCell.setMinimumHeight(20);

        PdfPCell imgTableHeaderCell=new PdfPCell();
        // 设置表格的表头单元格颜色
        imgTableHeaderCell.setHorizontalAlignment(PdfPCell.ALIGN_LEFT);
        imgTableHeaderCell.setBorderWidth(0);

        imgTableHeaderCell.setPhrase(new Paragraph((title!=null&&title.length>=1) ? title[0] : "", fontChinese));
        tableImg.addCell(imgTableHeaderCell);

        if(bese64Img.length==2){
            imgTableHeaderCell.setPhrase(new Paragraph((title!=null&&title.length>=2) ? title[1] : "", fontChinese));
            tableImg.addCell(imgTableHeaderCell);
        }

        String imgStr=bese64Img[0];
        Base64 base64=new Base64();
        String[] arr=imgStr.split("base64,");

        // Base64解码
        byte[] bytes;
        try{
            bytes=base64.decode(imgStr.split("base64,")[1].getBytes());
            for (int i=0; i<bytes.length; i++){
                if(bytes[i]<0){
                    bytes[i]+=256;
                }
            }
            Image jpg=Image.getInstance(bytes);

            jpg.getHeight();

            imgCell.addElement(jpg);
            if(bese64Img.length==1){
                tableImg.setTotalWidth(new float[] { 800.0f });
            }
            tableImg.addCell(imgCell);
        }catch(Exception e){
            e.printStackTrace();
        }

        if(bese64Img.length>=2){
            imgStr=bese64Img[1];
            arr=imgStr.split("base64,");
            // Base64解码
            try{
                bytes=base64.decode(imgStr.split("base64,")[1].getBytes());
                for (int i=0; i<bytes.length; i++){
                    if(bytes[i]<0){
                        bytes[i]+=256;
                    }
                }
                Image jpg=Image.getInstance(bytes);
                imgCell=new PdfPCell();
                imgCell.setBorder(0);
                imgCell.setHorizontalAlignment(PdfPCell.ALIGN_CENTER);
                imgCell.addElement(jpg);
                tableImg.addCell(imgCell);
            }catch(Exception e){
                e.printStackTrace();
            }
        }

        if(bese64Img.length>=3){
            imgStr=bese64Img[2];
            arr=imgStr.split("base64,");
            // Base64解码
            try{
                bytes=base64.decode(imgStr.split("base64,")[1].getBytes());
                for (int i=0; i<bytes.length; i++){
                    if(bytes[i]<0){
                        bytes[i]+=256;
                    }
                }
                Image jpg=Image.getInstance(bytes);
                imgCell=new PdfPCell();
                imgCell.setBorder(0);
                imgCell.setHorizontalAlignment(PdfPCell.ALIGN_CENTER);
                imgCell.addElement(jpg);
                tableImg.addCell(imgCell);
            }catch(Exception e){
                e.printStackTrace();
            }
        }

        try{
            document.add(tableImg);
        }catch(DocumentException e){
            e.printStackTrace();
        }
        return document;
    }

    public static Document addImgsTable(Document document, String bese64Img, String title) {
        float maximageHeight=480;
        addImgsTable(document, bese64Img, title, maximageHeight);
        return document;
    }

    public static void addImgsTable(Document document, String bese64Img, String title, float maximageHeight) {
        float titilfontsize=20;
        addImgsTable(document, bese64Img, title, maximageHeight, titilfontsize);
    }

    public static void addImgsTable(Document document, String bese64Img, String title, float maximageHeight, float titilfontsize) {
        BaseFont bfChinese=null;
        try{
            bfChinese=BaseFont.createFont("STSong-Light", "UniGB-UCS2-H", BaseFont.NOT_EMBEDDED);
        }catch(DocumentException e1){
            e1.printStackTrace();
        }catch(IOException e1){
            e1.printStackTrace();
        }
        Font fontChinese=new Font(bfChinese, titilfontsize, Font.BOLD);

        PdfPTable tableImg=new PdfPTable(1);

        tableImg.setWidthPercentage(100);

//        logger.debug("总宽度"+tableImg.getTotalWidth());

        tableImg.setHorizontalAlignment(PdfPTable.ALIGN_LEFT);

        // 创建一个表格的表头单元格
        PdfPCell imgCell=new PdfPCell();
        imgCell.setBorderWidth(0);
        // imgCell.setHorizontalAlignment(PdfPCell.ALIGN_CENTER);
        imgCell.setMinimumHeight(20);

        PdfPCell imgTableHeaderCell=new PdfPCell();
        // 设置表格的表头单元格颜色
        imgTableHeaderCell.setHorizontalAlignment(PdfPCell.ALIGN_LEFT);
        imgTableHeaderCell.setBorderWidth(0);

        Paragraph titlepa=new Paragraph(title, fontChinese);
        titlepa.setSpacingBefore(2);
        titlepa.setSpacingAfter(14);
        imgTableHeaderCell.setPhrase(titlepa);
        imgTableHeaderCell.setMinimumHeight(30);
        imgTableHeaderCell.setPaddingTop(15);
        imgTableHeaderCell.setPaddingBottom(15);
        tableImg.addCell(imgTableHeaderCell);

        String imgStr=bese64Img;
        Base64 base64=new Base64();
        // Base64解码
        byte[] bytes;
        try{
            bytes=base64.decode(imgStr.split("base64,")[1].getBytes());
            for (int i=0; i<bytes.length; i++){
                if(bytes[i]<0){
                    bytes[i]+=256;
                }
            }
            Image jpg=Image.getInstance(bytes);
            float height=jpg.getHeight();
            float width=jpg.getWidth();
            if(height>maximageHeight){
                width=maximageHeight/height*width;
                height=maximageHeight;

                if(width>820){
                    width=820;
                }
            }
            jpg.scaleAbsolute(width, height);
            jpg.setAlignment(jpg.ALIGN_CENTER);
            // jpg.setAlignment(Element.ALIGN_MIDDLE);
            //logger.debug("addImgsTable 获取图片的宽度"+jpg.getWidth()+",高"+jpg.getHeight()+",设置后宽度："+width);
            //jpg.setAlignment(Element.ALIGN_MIDDLE);
            imgCell.addElement(jpg);
            imgCell.setHorizontalAlignment(PdfPCell.ALIGN_CENTER);
            imgCell.setVerticalAlignment(PdfPCell.ALIGN_MIDDLE);

            tableImg.setTotalWidth(new float[] { 820 });
            tableImg.addCell(imgCell);

            // tableImg.setLockedWidth(true);
        }catch(Exception e){
            e.printStackTrace();
        }

        try{
            document.add(tableImg);
        }catch(DocumentException e){
            e.printStackTrace();
        }
    }

    public static void addDataTableCom(Document document, String[] titles, String[] keys, List<Map> list) {
        BaseFont bfChinese=null;
        try{
            bfChinese=BaseFont.createFont("STSong-Light", "UniGB-UCS2-H", BaseFont.NOT_EMBEDDED);
        }catch(DocumentException e1){
            e1.printStackTrace();
        }catch(IOException e1){
            e1.printStackTrace();
        }
        Font fontChinese=new Font(bfChinese, 14, Font.NORMAL);
        Font fontChinese8=new Font(bfChinese, 8, Font.NORMAL);

        PdfPTable table=new PdfPTable(titles.length);
        // 设置表格占PDF文档100%宽度
        table.setWidthPercentage(100);
        // 水平方向表格控件左对齐
        table.setHorizontalAlignment(PdfPTable.ALIGN_LEFT);
        // 创建一个表格的表头单元格
        PdfPCell pdfTableHeaderCell=new PdfPCell();
        // 设置表格的表头单元格颜色
        pdfTableHeaderCell.setHorizontalAlignment(PdfPCell.ALIGN_CENTER);

		/*
		 * pdfTableHeaderCell.setPhrase(new Paragraph("省", fontChinese)); table.addCell(pdfTableHeaderCell);
		 */
        // 添加标题
        for (int i=0; i<titles.length; i++){
            pdfTableHeaderCell.setPhrase(new Paragraph(titles[i], fontChinese));
            table.addCell(pdfTableHeaderCell);
        }

        // 创建一个表格的正文内容单元格
        PdfPCell pdfTableContentCell=new PdfPCell();
        pdfTableContentCell.setHorizontalAlignment(PdfPCell.ALIGN_CENTER);
        pdfTableContentCell.setVerticalAlignment(PdfPCell.ALIGN_MIDDLE);
        // 表格内容行数的填充
		/*
		 * for (int i = 0; i < 20; i++) { pdfTableContentCell.setPhrase(new Paragraph(i + "", fontChinese8)); table.addCell(pdfTableContentCell); }
		 */

        if(list!=null&&list.size()>0){
            Map tempMap=null;
            for (int i=0; i<list.size(); i++){
                tempMap=list.get(i);
                if(keys!=null&&keys.length>0){
                    for (int j=0; j<keys.length; j++){
                        pdfTableContentCell.setPhrase(new Paragraph(tempMap.get(keys[j]+"")+"", fontChinese8));
                        table.addCell(pdfTableContentCell);
                    }
                }
            }
        }

        try{
            document.add(table);
        }catch(DocumentException e){
            e.printStackTrace();
        }

    }

    public static void addDataTable(Document document, String[] titles, String[] keys, List<Map> list) {
        BaseFont bfChinese=null;
        try{
            bfChinese=BaseFont.createFont("STSong-Light", "UniGB-UCS2-H", BaseFont.NOT_EMBEDDED);
        }catch(DocumentException e1){
            e1.printStackTrace();
        }catch(IOException e1){
            e1.printStackTrace();
        }
        Font fontChinese=new Font(bfChinese, 18, Font.NORMAL);
        Font fontChinese8=new Font(bfChinese, 22, Font.NORMAL);

        PdfPTable table=new PdfPTable(titles.length);
        // 设置表格占PDF文档100%宽度
        table.setWidthPercentage(100);


        // 水平方向表格控件左对齐
        table.setHorizontalAlignment(PdfPTable.ALIGN_LEFT);
        // 创建一个表格的表头单元格
        PdfPCell pdfTableHeaderCell=new PdfPCell();

        pdfTableHeaderCell.setMinimumHeight(30);

        // 设置表格的表头单元格颜色
        pdfTableHeaderCell.setBackgroundColor(new BaseColor(136, 136, 136));
        pdfTableHeaderCell.setHorizontalAlignment(PdfPCell.ALIGN_CENTER);
		/*
		 * pdfTableHeaderCell.setPhrase(new Paragraph("省", fontChinese)); table.addCell(pdfTableHeaderCell);
		 */
        // 添加标题
        for (int i=0; i<titles.length; i++){
            pdfTableHeaderCell.setPhrase(new Paragraph(titles[i], fontChinese));
            table.addCell(pdfTableHeaderCell);
        }

        // 创建一个表格的正文内容单元格
        PdfPCell pdfTableContentCell=new PdfPCell();
        pdfTableContentCell.setHorizontalAlignment(PdfPCell.ALIGN_CENTER);
        pdfTableContentCell.setVerticalAlignment(PdfPCell.ALIGN_MIDDLE);
        // 表格内容行数的填充
		/*
		 * for (int i = 0; i < 20; i++) { pdfTableContentCell.setPhrase(new Paragraph(i + "", fontChinese8)); table.addCell(pdfTableContentCell); }
		 */

        if(list!=null&&list.size()>0){
            Map tempMap=null;
            for (int i=0; i<list.size(); i++){
                tempMap=list.get(i);
                if(keys!=null&&keys.length>0){
                    for (int j=0; j<keys.length; j++){
                        if(tempMap.get(keys[j]+"")==null){
                            pdfTableContentCell.setPhrase(new Paragraph(((tempMap.get(keys[j]+"")==null ? "-" : ((tempMap.get(keys[j]+"")+"")))), fontChinese8));
                        }else if("null%".equals((tempMap.get(keys[j]+"")))){
                            pdfTableContentCell.setPhrase(new Paragraph((("null%".equals((tempMap.get(keys[j]+""))) ? "0%" : ((tempMap.get(keys[j]+"")+"")))), fontChinese8));
                        }else{
                            pdfTableContentCell.setPhrase(new Paragraph(tempMap.get(keys[j]+"")+"", fontChinese8));
                        }
                        pdfTableContentCell.setMinimumHeight(30);
                        table.addCell(pdfTableContentCell);
                    }
                }
            }
        }

        // 加入隔行换色事件
        PdfPTableEvent event=new AlternatingBackground();
        table.setTableEvent(event);

        try{
            document.add(table);
        }catch(DocumentException e){
            e.printStackTrace();
        }

    }

